package com.selectionarts.projectcensio.openReqServices.eDemocracy.model.report;

public class EDemoParticipation {

	private int users_voted;
	private int users;
	private int candidates_voted;
	private int candidates;
	
	public EDemoParticipation() {
		// TODO Auto-generated constructor stub
	}

	public int getUsers_voted() {
		return users_voted;
	}

	public void setUsers_voted(int users_voted) {
		this.users_voted = users_voted;
	}

	public int getUsers() {
		return users;
	}

	public void setUsers(int users) {
		this.users = users;
	}

	public int getCandidates_voted() {
		return candidates_voted;
	}

	public void setCandidates_voted(int candidates_voted) {
		this.candidates_voted = candidates_voted;
	}

	public int getCandidates() {
		return candidates;
	}

	public void setCandidates(int candidates) {
		this.candidates = candidates;
	}
    
	
}
